import java.util.Scanner;


public class fuckStreaming {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc;
		sc = new Scanner(System.in);
		while(sc.hasNext()){
			String line = sc.nextLine();
			System.out.println(line);
		}
	}

}
